window.bookSummaryJSON = "<p>He's the ass-kicking, wise-cracking, hard-drinking demon hunter you never knew you needed. He's Quincy Harker, and he's here to save your ass whether you want it or not. The immortal magic-wielding son of Jonathan Harker and Mina Murray from the classic novel <i>Dracula</i>, Harker now lives in North Carolina hunting down demons and sending them back to Hell.</p> <p>This Omnibus Edition collects the first 12 novellas in the Quincy Harker series. Included here are:</p> <p><b>Year One</b><br> <i>Raising Hell</i><br> <i> Straight to Hell</i><br> <i> Hell on Heels</i><br> <i> Hell Freezes Over</i></p> <p><b>The Cambion Cycle</b><br> <i>Heaven Sent</i><br> <i> Heaven's Door</i><br> <i> Heaven Help Us</i><br> <i> Heaven Can Wait</i></p> <p><b>Damnation</b><br> <i>Calling All Angels</i><br> <i> Devil Inside</i><br> <i> Angel Dance</i></p>"; 
